import React from 'react';
import { Route } from 'react-router-dom';

const RouteNormal = ({
    layout: Layout,
    component: Component,
    ...props
}) => {
    if (!Layout) {
        return (
            <Route render>
                <Component {...props} />
            </Route>
        )}
    return (
        <Layout>
            <Route>
                <Component {...props} />
            </Route>

        </Layout>
    );
};

export default RouteNormal;
